INSERT INTO `cpl` (`id_cpl`, `cpl`, `id_kurikulum`) VALUES
('TF-01', 'Memegang teguh nilai-nilai kristiani, terutama kasih, integritas, pertumbuhan, kerendahan hati, dan kebenaran', 1),
('TF-02', 'Menunjukkan sikap mau berkontribusi untuk kemajuan bangsa dan negara sesuai bidangnya', 1),
('TF-03', 'Mempunyai jiwa kepemimpinan dengan memanfaatkan teknologi digital sesuai dengan bidang keilmuannya ', 1),
('TF-04', 'Mampu memformulasikan solusi atas masalah komputasi kompleks berdasarkan teori matematika, konsep ilmu komputer, dan teknik pemrograman yang terstruktur, modular, dan/atau berorientasi objek', 1),
('TF-05', 'Mampu menilai beragam metodologi pengembangan perangkat lunak dengan kompleksitas, fungsi, tujuan, dan platform masing-masing', 1),
('TF-06', 'Mampu membangun aplikasi tepat guna berbasis platform teknologi informasi dan komunikasi (TIK) atau teknologi terapannya serta memanfaatkannya untuk meningkatkan kualitas hidup', 1),
('TF-07', 'Mampu menyusun, mengirimkan, dan mengelola solusi kebutuhan proses-proses bisnis organisasi dalam rangka pengembangan sistem informasi atau aplikasi bisnis yang mendukung tercapainya tujuan organisasi', 1),
('TF-08', 'Mampu menganalisis data secara logis, kritis, sistematis, dan inovatif dalam konteks pengembangan ilmu pengetahuan dan teknologi, dengan menjunjung tinggi nilai humaniora', 1),
('TF-09', 'Mampu mendokumentasikan dan melaporkan deskripsi saintifik hasil kajian, serta menyimpan, mengamankan, dan menemukan kembali data saintifik terkait untuk menjamin kesahihan dan mencegah plagiasi', 1),
('TF-10', 'Menghargai semangat kemandirian, kejuangan, dan kewirausahaan sesuai keilmuan dan keahlian, serta berupaya menjalankannya secara bertanggung-jawab', 1);
